export let commits = []
export function commitScraper () {
    
    
     return fetch ("https://api.github.com/repos/BrightNate1022/git_scrap/commits")
    .then (shit => shit.json())
    // .then (console.log (response))
     
    .then (data => commits.push(data))
    // .then (data => console.log(data.commits_url))
    // console.log(commits)
 
    
}
